import Navbar from './nav-bar';
import SimpleSlider from './slider'
import Banners from './Banners'
import Cards from './Cards';
import './App.css';

function App() {
  return (
    <div>
    <Navbar />
    <SimpleSlider/>
    <Banners />
    <div className="home_cards">
      <Cards srcset="https://a0.muscache.com/im/pictures/b2f98185-f3bf-40db-ba8d-da0bceeccc65.jpg?im_w=960 1x, https://a0.muscache.com/im/pictures/b2f98185-f3bf-40db-ba8d-da0bceeccc65.jpg?im_w=1920 2x" 

      />
      <Cards />
    </div>
    </div>
  );
}

export default App;
